import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open guest selection menu
    await page.waitForSelector('.guest-selector');
    await page.click('.guest-selector');
    await page.waitForSelector('#guestMenu');

    // Select 2 adults
    await page.waitForSelector('button:contains("+")'); // Wait for the "+" button for adults
    await page.click('button:contains("+")'); // Click to add 1 adult
    await page.click('button:contains("+")'); // Click to add another adult

    // Select 1 child
    await page.waitForSelector('button:contains("+")'); // Wait for the "+" button for children
    await page.click('button:contains("+")'); // Click to add 1 child

    // Verify guest count display
    const guestCountText = await page.$eval('#guestCount', el => el.textContent);

    // Take screenshot after selecting guests
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_guest_selection.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_guest_selection.png'));

    // Return extracted data for verification
    return {
      success: true,
      action: "Selected 2 adults and 1 child in guest selection menu",
      extractedData: { guestCountText },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

